import React, {Component} from 'react';
import './styles.scss';
import Register from '../../layout/register';

class Left extends Component{
  render(){
    return (
	    <div>
	      	<div className="col-md-12 Left">
				<div className="Login">
					<h2>LOGIN</h2>
					<form className="formLogin" action="profile" method="Post">
						Email:<br />
						<input className="Email" placeholder="" type="text"  name ="userEmail" required=""></input>
						<br />
						Password:<br />
						<input className="Pass" placeholder="" type="password"  name ="pws" required=""></input>
					</form>
					<button type="button" className="btn btn-default ">LOGIN</button>
					<link to ="/signup"><button type="button" className="btn btn-default register">SIGN UP</button></link>
					<p>&copy; 2019 Terralogic.Inc</p>
				</div>
			</div>
	    </div>
  );
  }
}

export default Left;
